            <div className="container my-5">
                <button className="btn btn-primary" onClick={()=>setAddSection(true)} >Create Landlord</button>

                {
                    addSection &&(
                            <div className="addContainer">
                                <form onSubmit={handleSubmit}>
                            <div className="btn btn-danger close-btn" onClick={()=>setAddSection(false)}>close</div>

                        
                            <label htmlFor="title">Title:</label>
                            <input type="text" id="title" name="title" onChange={handleChange} required></input>

                            <label htmlFor="name">First Name:</label>
                            <input type="text" id="name" name="name" onChange={handleChange} required></input>

                            <label htmlFor="surname">Surname:</label>
                            <input type="text" id="surname" name="surname" onChange={handleChange} required></input>

                            <label htmlFor="phone">Phone:</label>
                            <input type="number" id="phone" name="phone" onChange={handleChange} required></input>

                            <label htmlFor="email">Email:</label>
                            <input type="email" id="email" name="email" onChange={handleChange} required></input>

                            <label htmlFor="address1">Address Line 1:</label>
                            <input type="text" id="address1" name="address1" onChange={handleChange} required></input>

                            <label htmlFor="address2">Address Line 2:</label>
                            <input type="text" id="address2" name="address2" onChange={handleChange} ></input>

                            <label htmlFor="town">Town:</label>
                            <input type="text" id="town" name="town" onChange={handleChange} required></input>

                            <label htmlFor="city">City:</label>
                            <input type="text" id="city" name="city" onChange={handleChange} required></input>

                            <label htmlFor="eircode">Eircode:</label>
                            <input type="text" id="eircode" name="eircode" onChange={handleChange} required></input>

                            <button type="submit" className="btn btn-primary">Submit</button>

                    </form>
                </div>

                    )
                }

                <div className="text-center mb-5">
                    <table>
                        <thead>
                            <tr>
                                <th>Title</th>
                                <th>Name</th>
                                <th>Surname</th>
                                <th>Phone</th>
                                <th>Email</th>
                                <th>Address1</th>
                                <th>Address2</th>
                                <th>Town</th>
                                <th>City</th>
                                <th>Eircode</th>
                                
                                
                            </tr>
                        </thead>
                        <tbody>


                            {
                                dataList.map((el) =>{
                                    return(
                                        <tr>
                                            <td>{el.title}</td>
                                            <td>{el.name}</td>
                                            <td>{el.surname}</td>
                                            <td>{el.phone}</td>
                                            <td>{el.email}</td>
                                            <td>{el.address1}</td>
                                            <td>{el.address2}</td>
                                            <td>{el.town}</td>
                                            <td>{el.city}</td>
                                            <td>{el.eircode}</td>
                                            <td>
                                            <button className="btn btn-edit">Edit</button>
                                            <button className="btn btn-delete">Delete</button>
                                            </td>
                                        </tr>
                                    )
                                })
                            }
                        </tbody>
                    </table>
                </div>
            </div>
        </>
    );
}

export default Landlord;
